【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ やわらか伸縮すき間ノズルやソフトブラシ。クルマに適した多彩なアタッチメント。<br />自動車の掃除に便利な4種類のアタッチメント。硬めのブラシはフロアマットに入り込んだ砂などをかき出します。柔らかめのブラシは、シートのゴミや髪の毛などをからめ取ったり、ダッシュボードやドアの内張を掃除できます。これまであきらめていたすき間にもしっかり届きます。<br /><br />★ 家の掃除でも大活躍。<br />冷蔵庫やテレビの裏、ソファのすき間などの狭いところは得意中の得意です。また強い吸引力で、シュレッダーのまわりに落ちた小さな紙切れや、カーペットの間に絡まったペットの毛などもかき出して吸込んでくれます。<br /><br />★ 紙パック不要のサイクロン式<br /><br />★ 0.7Lの大容量ダストケース<br /><br />★ 排気もきれいなプリーツフィルター<br /><br />★ 余裕の6m電源コード</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>仕様</h3><p>* 集塵方式：サイクロン式<br />* ノズルタイプ：フロアブラシ<br />* 吸込仕事率：180W<br />* 消費電力：650W<br />* 本体寸法(約)：幅140×奥行295×高さ230mm<br />* 本体質量(約)：1.9kg(フロアブラシ含む)<br />* 運転音(約)：75dB以下<br />* 集塵容積(約)：0.7L<br />* 電源コード長さ(約)：6m<br />* 付属品：フロアブラシ、ソフトブラシ、柔から伸縮すき間ノズル、延長パイプ、アタッチメント収納袋</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
